import logo from './logo.svg';
import './App.css';
import{
  BrowserRouter,
  Routes,
  Route
}from "react-router-dom";
import HomePage from './component/HomePage';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<HomePage/>}></Route>

      </Routes>



      </BrowserRouter>
    </div>
  );
}

export default App;
